import React from 'react';
import { Box, Grid } from "@mui/material";

const Recents = () => {
    return (
        <Box>
            <Grid container>
                <Grid item md={6} xs={12}sx={{ background: 'tomato' }}>Item1</Grid>
                <Grid item md={3} xs={6} sx={{ background: 'red' }}>Item2</Grid>
                <Grid item md={3} xs={7} sx={{ background: 'blue' }}>Item3</Grid>
            </Grid>
        </Box>
    )
}

export default Recents;
